import React , {Component} from 'react';



class Fill extends Component{


    tilte(me){
        return(
            <h4> it's me to {me}!!!!</h4>
        )
    }


    render(){

        const titre = "it's me my brother yh!!!!";
        const title2 = this.tilte('salah');

        return(
            <div>

            <h4 className='text-center text-primary mt-4'>{titre}</h4>
            <h4 className='text-center text-primary mt-4'>{title2}</h4>

            </div>
          
        )
    }
}


export default Fill;
